import { useState } from "react";
import { MouseEvent } from "react";
//<button type="button" className="btn btn-primary" onClick={()=> setselect(index)}>Primary</button>
//const [select, setselect] = useState(-2);

function List() {

  const liste = ["toto","tomate","oigons"];
  return (
    <>
      <ul class="list-group">
        <li class="list-group-item active">{liste}</li>
        
      </ul>
    </>
  );
}

export default List;
